import React, { Component } from 'react';
import EventService from "../../../service/event.service"

import { GoogleMap, withScriptjs, withGoogleMap, Marker} from 'react-google-maps';


class Maps extends Component {

    constructor(props) {
        super(props)
        this.state = {
            events: {
                name: "",
                longitude: "",
                latitude:"",
            }
        }
        console.log(props)
        this.eventService = new EventService()

    }


    render() {


        return (
<>
            <GoogleMap
                defaultZoom={15}
                defaultCenter={{ lat: parseFloat(this.props.latitude), lng: parseFloat(this.props.longitude) }}
            />
            <Marker 
                    position={{ lat: parseFloat(this.props.latitude), lng: parseFloat(this.props.longitude) }}
                    name={this.props.name}
                />
</>
        )
    }
}

export default withScriptjs(withGoogleMap(Maps))

export class MapContainer extends Component {
    constructor(props) {
        super(props);

        this.state = {
            stores: [{ lat: 47.49855629475769, lng: -122.14184416996333 },
            { latitude: 47.359423, longitude: -122.021071 },
            { latitude: 47.2052192687988, longitude: -121.988426208496 },
            { latitude: 47.6307081, longitude: -122.1434325 },
            { latitude: 47.3084488, longitude: -122.2140121 },
            { latitude: 47.5524695, longitude: -122.0425407 }]
        }
    }

    displayMarkers = () => {
        return this.state.stores.map((store, index) => {
            return <Marker key={index} id={index} position={{
                lat: store.latitude,
                lng: store.longitude
            }}
                onClick={() => console.log("You clicked me!")} />
        })
    }

    render() {
        return (
            <Map
                google={this.props.google}
                zoom={8}
                style={mapStyles}
                initialCenter={{ lat: 47.444, lng: -122.176 }}
            >
                {this.displayMarkers()}
            </Map>
        );
    }
}
